import React, { useState, useEffect } from 'react';
import axios from 'axios';

const StockDataFetcher = () => {
  const [stockData, setStockData] = useState({
    day_trading: [],
    long_term: [],
    swing_trading: []
  });

  const generateAIComment = async (ticker, category, stock) => {
    const api_url = "https://api-inference.huggingface.co/models/meta-llama/Meta-Llama-3-8B-Instruct";
    const headers = {
      "Authorization": "Bearer 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"
    };
    const intros = [
      `${ticker} shows potential for ${category.toLowerCase()} trading. Based on multiple filters, it stands out for its strong technical signals.`,
      `Our analysis indicates that ${ticker} is a good fit for ${category.toLowerCase()} strategies due to its robust technical indicators.`,
      `${ticker} has been identified as a strong candidate for ${category.toLowerCase()} trading. We used various technical filters to determine this.`,
      `By leveraging several technical indicators, ${ticker} appears promising for ${category.toLowerCase()} trading strategies.`,
      `Using different technical filters, ${ticker} emerges as a top candidate for ${category.toLowerCase()} trading strategies.`
    ];
    const intro = intros[Math.floor(Math.random() * intros.length)];
    const prompt = `${intro} Using Bollinger Bands, moving averages, and other technical indicators, we identified it as a strong candidate. `
      + `Data scraped from the web supports this analysis. Now, let's break down the rationale behind our choice: `
      + `1. Bollinger Bands: ${ticker}'s Bollinger Bands have been contracting, indicating decreasing volatility. `
      + `2. Moving Averages: The stock is trading above its 50-day and 200-day moving averages. `
      + `3. RSI: The RSI indicates a favorable trading condition. `
      + `4. Volume: The trading volume supports the current trend. `
      + `5. MACD: The MACD shows bullish momentum. `
      + `Entry: Buy above the upper Bollinger Band. Exit: Sell at the lower Bollinger Band.`;

    try {
      const response = await axios.post(api_url, { inputs: prompt }, { headers });
      if (response.status === 200) {
        let result = response.data[0].generated_text;
        result = result.replace(/Disclaimer:.*|#\w+|\*.*|Replay.*|Watch next:.*|This analysis should not.*|Technical Indicator:.*|Keep in mind.*|Share your thoughts!.*|\$\d+(\.\d+)?|\d+(\.\d+)?%|\d+(\.\d+)?/g, '').trim();
        return result;
      } else {
        console.error(`Error: ${response.status} - ${response.statusText}`);
        return "AI Analysis unavailable.";
      }
    } catch (error) {
      console.error('Error fetching AI analysis:', error);
      return "AI Analysis unavailable.";
    }
  };

  useEffect(() => {
    const fetchDataAndAIComments = async () => {
      try {
        const response = await axios.get('http://localhost:5000/get-stock-data');
        const data = response.data;

        // Fetch AI comments for each stock
        for (const category in data) {
          if (data.hasOwnProperty(category)) {
            for (const stock of data[category]) {
              stock.ai_comment = await generateAIComment(stock.ticker, category, stock);
            }
          }
        }

        setStockData(data);
      } catch (error) {
        console.error('Error fetching the stock data:', error);
      }
    };

    fetchDataAndAIComments();
  }, []);

  const renderStockList = (stocks, category) => (
    <div key={category}>
      <h2>{category.replace('_', ' ').toUpperCase()}</h2>
      <ul>
        {stocks.map((stock, index) => (
          <li key={index}>
            <p>Ticker: {stock.ticker}</p>
            <p>Name: {stock.name}</p>
            <p>Volume: {stock.volume}</p>
            <p>Price: {stock.price}</p>
            <p>Market Cap: {stock.market_cap}</p>
            <p>P/E Ratio: {stock.pe_ratio}</p>
            <p>Change Percent: {stock.change_percent}%</p>
            <p>50 MA: {stock['50_MA']}</p>
            <p>200 MA: {stock['200_MA']}</p>
            <p>RSI: {stock.RSI}</p>
            <p>Upper BB: {stock.Upper_BB}</p>
            <p>Lower BB: {stock.Lower_BB}</p>
            <p>AI Analysis: {stock.ai_comment}</p>
          </li>
        ))}
      </ul>
    </div>
  );

  return (
    <div>
      <h1>Stock Data</h1>
      {stockData.day_trading.length > 0 && renderStockList(stockData.day_trading, 'day_trading')}
      {stockData.long_term.length > 0 && renderStockList(stockData.long_term, 'long_term')}
      {stockData.swing_trading.length > 0 && renderStockList(stockData.swing_trading, 'swing_trading')}
    </div>
  );
};

export default StockDataFetcher;
